import React from 'react';
import { Link } from 'react-router-dom';
import { HeaderArea } from './styled';

import logo from './logo_ReGep.png'

const Header = () => {
    return (
        <HeaderArea>
            <div className="container">
                <div className="logo">
                    <Link to="/">
                        <img className="logo" src={logo} alt="Logo" />
                    </Link>
                </div>
            </div>
        </HeaderArea>
    );
}

export default Header;
